<body>
  <header>
    <h1>Topâ€‘N AI picked portfolio vs Russell 1000</h1>
    <p>Interactive (client-side) view. Cumulative returns are rebased within the selected window. Raw panel data is not published.</p>
  </header>

  <div class="wrap">
    <div class="grid">
      <div class="card">
        <div>
          <label for="nSelect">Top N</label>
          <select id="nSelect"></select>
        </div>
        <div style="height:12px"></div>
        <div class="row">
          <div>
            <label for="startDate">Start</label>
            <input id="startDate" type="date" />
          </div>
          <div>
            <label for="endDate">End</label>
            <input id="endDate" type="date" />
          </div>
        </div>
        <div style="height:12px"></div>
        <div class="small" id="status">Loadingâ€¦</div>
        <div class="footer">
          Y-axis fixed to [90, 170].
        </div>
      </div>

      <div class="card">
        <div id="chart"></div>
      </div>
    </div>
  </div>

<script>
  // --- Optional inline dataset fallback ---
  // If you open index.html via file://, most browsers block fetch('./data.json').
  // When the build script copies this template into the publish folder, it can
  // also inject window.__DATASET__ into the copied file (or you can manually do it).
  // When hosted via HTTP(S), fetch will work and be used.

  function parseDate(s) { return new Date(s + 'T00:00:00'); }
  function fmtDate(d) {
    const yyyy = d.getFullYear();
    const mm = String(d.getMonth()+1).padStart(2,'0');
    const dd = String(d.getDate()).padStart(2,'0');
    return `${yyyy}-${mm}-${dd}`;
  }

  function rebasedCumRet(retArray) {
    let wealth = 100.0;
    const out = [];
    for (let i = 0; i < retArray.length; i++) {
      const r = retArray[i];
      const rr = (r === null || r === undefined) ? 0.0 : Number(r);
      wealth *= (1.0 + rr);
      out.push(wealth);
    }
    return out;
  }

  function sliceByWindow(dates, vw, rsl, startStr, endStr) {
    const start = parseDate(startStr);
    const end = parseDate(endStr);
    const xd = [], v = [], b = [];
    for (let i = 0; i < dates.length; i++) {
      const d = parseDate(dates[i]);
      if (d >= start && d <= end) {
        xd.push(dates[i]);
        v.push(vw[i]);
        b.push(rsl[i]);
      }
    }
    return { xd, v, b };
  }

  function render(dataset, nStr, startStr, endStr) {
    const series = dataset.series[nStr];
    if (!series) {
      document.getElementById('status').textContent = `No series for N=${nStr}`;
      return;
    }

    const sliced = sliceByWindow(dataset.date, series.vw_ret, series.rsl_ret, startStr, endStr);
    if (sliced.xd.length === 0) {
      document.getElementById('status').textContent = 'No data in selected window';
      Plotly.react('chart', [], {title: 'No data'});
      return;
    }

    const yVw = rebasedCumRet(sliced.v);
    const yRsl = rebasedCumRet(sliced.b);

    const data = [
      {
        x: sliced.xd,
        y: yVw,
        type: 'scatter',
        mode: 'lines',
        name: `Top ${nStr} AI picked, Value-Weighted`,
        line: {color:'#D95F02', width:3, dash:'dash'}
      },
      {
        x: sliced.xd,
        y: yRsl,
        type: 'scatter',
        mode: 'lines',
        name: 'Russell 1000 Index',
        line: {color:'#555555', width:2, dash:'dashdot'}
      }
    ];

    const layout = {
      title: {text: `Cumulative Return (Base 100) â€” rebased within selected window (Top ${nStr})`, x:0.02},
      template: 'plotly_white',
      height: 520,
      margin: {l:60, r:30, t:70, b:60},
      legend: {orientation:'h', yanchor:'bottom', y:1.02, xanchor:'left', x:0},
      xaxis: {title:'Date', type:'date', rangeslider: {visible:true}},
      yaxis: {title:'Cumulative Return (Base 100)'}
    };

    Plotly.react('chart', data, layout, {displaylogo:false, responsive:true});
    document.getElementById('status').textContent = `N=${nStr} | ${startStr} â†’ ${endStr} | ${sliced.xd.length} points`;
  }

  function clampDateStr(s, minStr, maxStr) {
    if (!s) return minStr;
    if (s < minStr) return minStr;
    if (s > maxStr) return maxStr;
    return s;
  }

  function applyDateConstraints(startEl, endEl, datasetMin, datasetMax) {
    // Hard bounds (valid range from dataset)
    startEl.min = datasetMin;
    startEl.max = datasetMax;
    endEl.min = datasetMin;
    endEl.max = datasetMax;

    // Soft bounds (enforce start <= end)
    // Start can't be after the currently selected end
    if (endEl.value) startEl.max = endEl.value;
    // End can't be before the currently selected start
    if (startEl.value) endEl.min = startEl.value;

    // Clamp values if they drifted out of range
    startEl.value = clampDateStr(startEl.value, startEl.min, startEl.max);
    endEl.value = clampDateStr(endEl.value, endEl.min, endEl.max);
  }

  async function loadDataset() {
    // Prefer inline dataset if present
    if (window.__DATASET__ && window.__DATASET__.date && window.__DATASET__.series) {
      return window.__DATASET__;
    }

    // Otherwise fetch next to this HTML
    const res = await fetch('./data.json', { cache: 'no-store' });
    if (!res.ok) {
      throw new Error(`Failed to load data.json (${res.status})`);
    }
    return await res.json();
  }

  async function main() {
    const status = document.getElementById('status');
    status.textContent = 'Loading dataâ€¦';

    let dataset;
    try {
      dataset = await loadDataset();
    } catch (e) {
      status.textContent = String(e && e.message ? e.message : e);
      // Common local-open hint
      status.textContent += '\nTip: open via a local web server (http://localhost/...) or enable inline dataset injection.';
      return;
    }

    if (!dataset || !dataset.series || !dataset.date || dataset.date.length === 0) {
      status.textContent = 'Dataset loaded but is empty/invalid.';
      return;
    }

    const nSelect = document.getElementById('nSelect');
    const startDate = document.getElementById('startDate');
    const endDate = document.getElementById('endDate');

    const nKeys = Object.keys(dataset.series).map(Number).sort((a,b)=>a-b).map(String);
    if (nKeys.length === 0) {
      status.textContent = 'Dataset has no N series.';
      return;
    }

    for (const k of nKeys) {
      const opt = document.createElement('option');
      opt.value = k;
      opt.textContent = k;
      nSelect.appendChild(opt);
    }
    const defaultN = nKeys.includes('20') ? '20' : nKeys[Math.floor(nKeys.length/2)];
    nSelect.value = defaultN;

    const minDate = dataset.date[0];
    const maxDate = dataset.date[dataset.date.length - 1];

    // Initialize values
    startDate.value = minDate;
    endDate.value = maxDate;

    // Apply constraints so out-of-range dates are not selectable
    applyDateConstraints(startDate, endDate, minDate, maxDate);

    const update = () => {
      // Re-apply constraints on every change to keep the pickers valid
      applyDateConstraints(startDate, endDate, minDate, maxDate);
      render(dataset, nSelect.value, startDate.value, endDate.value);
    };

    nSelect.addEventListener('change', update);
    startDate.addEventListener('change', update);
    endDate.addEventListener('change', update);

    update();
  }

  main();
</script>
</body>
